import React, { Component } from 'react'
import Logo from './Logo'
import Links from './Links'
import '../style/pages.css'

class NavBar extends Component {
    render() {
        return (
            <div className='nav_bar'>
                <Logo />
                <Links />
            </div>
        )
    }
}

export default NavBar
